//==================================//
//This function detects ie and edge (no clip path support) and makes it functional in small screens

function ieBrowserSupport(){
	var browser = navigator.userAgent;
	console.log('The Browser you are using is ' + browser);
}

//==================================//
//This function sets a starting class for the header. This starting class will be used for the resize function to prevent animations when initially loading

function preventHeaderBehaviors() {
	var header = document.getElementById('header');

	if(window.innerWidth <= 640){
		header.className = 'small';

	}else if(window.innerWidth > 640){
		header.className='large';
	}

}

//==================================//
//function to change header when resizing, prevents animations from loading on onload in css.

function headerBehavior() {
	var menuButton = document.getElementById('menu-button');
	var header = document.getElementById('header');
	var headerBorder= document.getElementById('header-border');
	var avatar = document.getElementById('avatar');
	var navbar = document.getElementById('navbar');

	if((window.innerWidth <= 640 && header.className==='large') || (window.innerWidth <= 640 && header.className==='changeToBox') || (window.innerWidth <= 640 && header.className === 'changeToLeaf close')){
		header.className = 'changeToLeaf';
		headerBorder.className = 'changeToLeaf';
		header.style.clipPath = 'url(#clip-leaf)';
		headerBorder.style.clipPath = 'url(#clip-leaf)';

        header.style.width = '7em';
        header.style.height = '7em';
        header.style.borderRadius = '50em';
        headerBorder.style.width = '7em';
        headerBorder.style.height = '7em';
        headerBorder.style.borderRadius = '50em';
		header.style.top = '0.5em';
		headerBorder.style.top = '0.5em';
		headerBorder.style.right = '1em';
		headerBorder.style.webkitTransform = 'scale(1.2)';
		headerBorder.style.MozTransform = 'scale(1.2)';
		headerBorder.style.msTransform = 'scale(1.2)';
		headerBorder.style.OTransform = 'scale(1.2)';
		headerBorder.style.transform = 'scale(1.2)';

		avatar.style.opacity = '0';
		navbar.style.opacity = '0';

	}else if ((window.innerWidth > 640 && header.className==='small') || (window.innerWidth > 640 && header.className==='changeToLeaf') || (window.innerWidth > 640 && header.className === 'changeToBox open')){

		header.style.top = '0';
		headerBorder.style.top = '0';
		headerBorder.style.right = '1.8em';

        header.style.width = '15em';
        header.style.height = '100%';
        header.style.borderRadius = '0em';
        headerBorder.style.width = '15em';
        headerBorder.style.height = '100%';
        headerBorder.style.borderRadius = '0em';
		header.className = 'changeToBox';
		headerBorder.className = 'changeToBox';
		header.style.clipPath = 'url(#clip-box)';
		headerBorder.style.clipPath = 'url(#clip-box)';
		headerBorder.style.webkitTransform = 'scale(1.1)';
		headerBorder.style.MozTransform = 'scale(1.1)';
		headerBorder.style.msTransform = 'scale(1.1)';
		headerBorder.style.OTransform = 'scale(1.1)';
		headerBorder.style.transform = 'scale(1.1)';

		avatar.style.opacity = '1';
		navbar.style.opacity = '1';

		menuButton.style.top = '2.6em';
		menuButton.style.right = '3.3em';
		menuButton.className = '';
	}

	if(window.innerWidth >640){
		clickEven = false;
	}
}

//==================================//
//function that actually works the functions such as menu controls

function menuFunctions() {
	var menuButton = document.getElementById('menu-button');
	var header = document.getElementById('header');
	var headerBorder= document.getElementById('header-border');
	var avatar = document.getElementById('avatar');
	var navbar = document.getElementById('navbar');

	if (clickEven === false) {
		header.className = 'changeToBox open';
		headerBorder.className = 'changeToBox open';
		header.style.clipPath = 'url(#clip-box)';
		headerBorder.style.clipPath = 'url(#clip-box)';

        header.style.width = '15em';
        header.style.height = '100%';
        header.style.borderRadius = '0em';
        headerBorder.style.width = '15em';
        headerBorder.style.height = '100%';
        headerBorder.style.borderRadius = '0em';
		header.style.top = '0';
		headerBorder.style.top = '0';
		headerBorder.style.right = '1.8em';
		headerBorder.style.webkitTransform = 'scale(1.1)';
		headerBorder.style.MozTransform = 'scale(1.1)';
		headerBorder.style.msTransform = 'scale(1.1)';
		headerBorder.style.OTransform = 'scale(1.1)';
		headerBorder.style.transform = 'scale(1.1)';

		menuButton.style.top = '1em';
		menuButton.style.right = '1em';
		menuButton.className = 'open';

		avatar.style.opacity = '1';
		navbar.style.opacity = '1';

		clickEven = true;
  }else if (clickEven === true){
		header.className = 'changeToLeaf close';
		headerBorder.className = 'changeToLeaf close';
		header.style.clipPath = 'url(#clip-leaf)';
		headerBorder.style.clipPath = 'url(#clip-leaf)';

        header.style.width = '7em';
        header.style.height = '7em';
        header.style.borderRadius = '50em';
        headerBorder.style.width = '7em';
        headerBorder.style.height = '7em';
        headerBorder.style.borderRadius = '50em';
		header.style.top = '0.5em';
		headerBorder.style.top = '0.5em';
		headerBorder.style.right = '1em';
		headerBorder.style.webkitTransform = 'scale(1.2)';
		headerBorder.style.MozTransform = 'scale(1.2)';
		headerBorder.style.msTransform = 'scale(1.2)';
		headerBorder.style.OTransform = 'scale(1.2)';
		headerBorder.style.transform = 'scale(1.2)';

		menuButton.style.top = '2.6em';
		menuButton.style.right = '3.3em';
		menuButton.className = '';

		avatar.style.opacity = '0';
		navbar.style.opacity = '0';

		clickEven = false;
  }
}

//==================================//
//function defines height of .divCollapse and 'expands' it

function openPostCollapse(event) {
	var number = this.id
	var postNumber = 'post_' + number;
	var contentNumber = 'content_' + number;

	var postCollapse = document.getElementById(postNumber);
	var content = document.getElementById(contentNumber);

	if(postCollapse.style.height === '4em'){
		this.innerHTML = '<i class="fa fa-minus-square" aria-hidden="true"></i>';
		postCollapse.style.height = 'auto';
		content.style.opacity = '1';
		content.style.pointerEvents = '';
	}else if(postCollapse.style.height = 'auto'){
		postCollapse.style.height = '4em';
		this.innerHTML = '<i class="fa fa-plus-square" aria-hidden="true"></i>';
		content.style.opacity = '0';
		content.style.pointerEvents = 'none';
	}
}

//==================================//
//function defines height of floaty-leaf

function floatyLeafStyle() {
	var floatyLeaf = document.getElementById('floaty-leaf');
	var navBarHeight = document.getElementById('navbar').clientHeight;

	floatyLeaf.style.height = navBarHeight + 'px';
}

//==================================//
//function sets the mouse Y position

function getYPos(event) {
	mouseYPos = event.clientY;
}

//==================================//
//function generates floaty-leaf hover content

function generateFallingLeaves() {
	var floatyLeaf=document.getElementById('floaty-leaf');
	var navBar=document.getElementById('navbar');
	var avatarHeight = document.getElementById('avatar').clientHeight;

	var i = Math.floor(Math.random()*colors.length);
	var j = Math.floor(Math.random()*leaves.length);
		var newDiv = document.createElement('div');
		newDiv.className = 'new-leaf';
		newDiv.style.top = (mouseYPos - avatarHeight - 24) + 'px'; //24 is half of newDiv size.. centered effect
		newDiv.style.right = 50 +'px'; //half of width of floaty-leaf div
		newDiv.style.backgroundColor = colors[i];
		newDiv.style.clipPath = leaves[j];

		floatyLeaf.appendChild(newDiv);
}

